import Chart from 'react-apexcharts'
import Button from '@mui/material/Button';

const SystemStats = () => {

    const state = {

        series: [70],
        options: {
            chart: {
                height: 350,
                type: 'radialBar',
            },
            plotOptions: {
                radialBar: {
                    hollow: {
                        size: '70%',
                    }
                },
            },
            labels: ['Tank Level'],
        },
    };
    return (
        <>
            <Chart
                options={state.options}
                series={state.series}
                type="line"
                width={500}
                height={320} />
            <Button variant="outlined">Update</Button>
        </>
    );
}

export default SystemStats;
